        .then(res) => {
            setProducts(res.data)
        .cathch(err)=>
            {

            }
            
        }

    },[])
    
  return (
    <section>
        {
            products.map((singleProduct)=>{
                return <ProductCard product={singleProduct} key={singleProduct.id}/>
 })
        }
    </section>
  )
}
